import React from "react";
import mwallet from "../mwallet.png";
import { Button } from "antd";

function Home() {
  return (
    <>
      <div className="content">
        <img src={mwallet} alt="logo" className="frontPageLogo" />
        <h2>Hey There !</h2>
        <h4 className="h4">Welcome to your Web3 Wallet</h4>
      </div>
    </>
  );
}

export default Home;
